fields.formula:
concat( 
  "TC", 
  if( 
    row_id() < 10, 
    concat("0000", row_id()), 
    if( 
      row_id() < 100, 
      concat("000", row_id()), 
      if( 
        row_id() < 1000, 
        concat("00", row_id()), 
        if( 
          row_id() < 10000, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ) 
  ) 
)

if( 
  count(field("Related scripts")) = 0, 
  "", 
  concat( 
    round(field("Percentage for filter"), 2), 
    "%" 
  ) 
)

if( 
  count(field("Related scripts")) = 0, 
  0, 
  multiply( 
    divide( 
      count( 
        filter( 
          field("Related scripts"), 
          lookup("Related scripts", "Is pass") 
        ) 
      ), 
      count(field("Related scripts")) 
    ), 
    100 
  ) 
)

join( 
  if( 
    or( 
      int(tonumber(right(totext(field("Test case ID")), 1))) = 1, 
      int(tonumber(right(totext(field("Test case ID")), 1))) = 6 
    ), 
    "S", 
    if( 
      or( 
        int(tonumber(right(totext(field("Test case ID")), 1))) = 2, 
        int(tonumber(right(totext(field("Test case ID")), 1))) = 7 
      ), 
      "R", 
      if( 
        or( 
          int(tonumber(right(totext(field("Test case ID")), 1))) = 3, 
          int(tonumber(right(totext(field("Test case ID")), 1))) = 8 
        ), 
        "Y", 
        if( 
          or( 
            int(tonumber(right(totext(field("Test case ID")), 1))) = 4, 
            int(tonumber(right(totext(field("Test case ID")), 1))) = 9 
          ), 
          "G", 
          "B"
        )
      )
    )
  ), 
  "" 
)

if( 
  field("Tests count") = 0, 
  "", 
  concat( 
    round( 
      field("Percentage for filter"), 
      2 
    ), 
    "%" 
  ) 
)

if( 
  field("Tests count") = 0, 
  0, 
  multiply( 
    divide( 
      count( 
        filter( 
          field("Related tests"), 
          int(lookup("Related tests", "Percentage for filter")) = 100 
        ) 
      ), 
      field("Tests count") 
    ), 
    100 
  ) 
)

if( 
  field("Tests count") < 0.01, 
  "", 
  concat( 
    round( 
      field("Percentage for filter"), 
      2 
    ), 
    "%" 
  ) 
)

if( 
  field("Tests count") = 0, 
  0, 
  multiply( 
    divide( 
      add( 
        count( 
          filter( 
            field("Related tests as manager"), 
            int(lookup("Related tests as manager", "Percentage for filter")) = 100 
          ) 
        ), 
        count( 
          filter( 
            field("Related tests as tester"), 
            int(lookup("Related tests as tester", "Percentage for filter")) = 100 
          ) 
        ) 
      ), 
      field("Tests count")
    ), 
    100 
  ) 
)
